def evaluate_origami_assay(prev, assay, n_trials):
    '''
        Applies origami assay to test network:
        https://www.smarterbetter.design/origamiassays/

        We assume that the assay covers a fraction of the network
        and only account for nodes covered.

        In case the test returns false positives, we test all
        positive cases in a second round.
    '''
    n_vertices = int(np.max(assay))+1
    short_infec_matrix = np.zeros((n_vertices, n_trials))

    nodes = list(np.arange(0,n_vertices))
    for t in range(n_trials):
        infected = random.sample(nodes, int(prev * n_vertices))
        short_infec_matrix[infected,t] = 1.

    posit_groups = np.zeros((len(assay), short_infec_matrix.shape[1]))

    posit_nodes = np.zeros(short_infec_matrix.shape)

    #Positive groups
    for i in range(len(assay)):
        posit_groups[i] = np.array(short_infec_matrix[assay[i]].sum(axis=0))[0]

    #Positive nodes
    for i in range(len(assay)):
        for j in range(short_infec_matrix.shape[1]):
            if posit_groups[i][j] > 0:
                for k in assay[i]:
                    posit_nodes[k][j] = posit_nodes[k][j] + 1

    n_tests = len(assay) * np.ones(short_infec_matrix.shape[1])

    #Users are considered positive if they appear
    #in the maximum number of positive groups.
    max_posit = int(np.max(posit_nodes))

    for j in range(posit_nodes.shape[1]):
        false_positive = False
        count_posit = 0
        for i in range(posit_nodes.shape[0]):
            if posit_nodes[i][j] >= max_posit:
                count_posit = count_posit + 1

                #Checking for false positives
                if short_infec_matrix[i,j] < .5:
                    false_positive = True

        #Secound-round tests if needed
        if false_positive is True:
            n_tests[j] = n_tests[j] + count_posit

    return n_tests / np.max(assay)


